g2:c.PROCEDURE.g2:a.TEXT:
length-validity-test(node: class benchmark-node )

k:integer;
emsg: text = "Internal lists length is inconsistent";

begin



for k = 0 to 10 do
 insert k at the beginning of list-1;
end;

if the list-size of list-1 /= 11 then begin
 call fail(node, emsg);
 return;
end;

for k = 1 to 10 do
 remove the first integer from list-1;
end; 

if the list-size of list-1 /= 1 then begin
 call fail(node, emsg);
 return;
end; 

for k = 0 to 10 do
 insert k at the end of list-1;
end; 

if the list-size of list-1 /= 12 then begin
 call fail(node, emsg);
 return;
end;

for k = 1 to 10 do
 insert k before the second integer in list-1 in list-1;
end; 

if the list-size of list-1 /= 22 then begin
 call fail(node, emsg);
 return;
end; 

for k = 1 to 10 do
 insert k before 1 in list-1;
end; 

if the list-size of list-1 /= 32 then begin
 call fail(node, emsg);
 return;
end; 

for k = 1 to 10 do
 insert k after list-1[10] in list-1;
end; 

if the list-size of list-1 /= 42 then begin
 call fail(node, emsg);
 return;
end; 

for k = 1 to 10 do
 insert k after element 14 of list-1;
end; 

if the list-size of list-1 /= 52 then begin
 call fail(node, emsg);
 return;
end; 

for k = 1 to 10 do
 insert k after 8 in list-1;
end; 

if the list-size of list-1 /= 62 then begin
 call fail(node, emsg);
 return;
end; 

for k = 1 to 6 do
 remove the last integer from list-1;
end; 

if the list-size of list-1 /= 56 then begin
 call fail(node, emsg);
 return;
end; 

for k = 1 to 3 do
 remove element 2 from list-1;
end; 

if the list-size of list-1 /= 53 then begin
 call fail(node, emsg);
 return;
end; 

if the list-size of list-1 /= the number of elements in list-1 then begin
 call fail(node, emsg);
 return;
end; 

call pass(node);


end

gensymcid-1308-test-inner(win : class g2-window) = (truth-value, text)
status : truth-value; 
status-text : text;
begin
repeat
    exit if the number of elements in LIST-1308 = 0;
    remove element 0 from LIST-1308;
    end;
insert "100" at the beginning of LIST-1308;
insert "200" at the beginning of LIST-1308;
insert "300" at the beginning of LIST-1308;
win = call rt-util-get-g2-server-window ();
call rt-util-hide-each-kb-workspace-visible-on-window-and-wait (win, 1);
call rt-util-show-ws-pretty-and-wait(the workspace of this procedure, win, 1, 1);
status, status-text = call do-iconic-item-menu-selections(LIST-1308,sequence("table"));
if status then return status, status-text;
status, status-text = call right-click-on-text-if-visible("List size");
wait for 0.5 second;
status, status-text = call do-existing-menu-selections(sequence("edit"));
if status then 
    begin
    if is-contained-in-text ("Player failed to find target text edit to click on",status-text) then
        // Absense of 'edit' in the menu of "List size" means that the list is read-only
        return false,""
    else
        return status, status-text;
    end;
wait for 0.5 second;
call rt-util-send-key-by-symbol-and-wait (the symbol backspace, 0.5);
call type-string("33");
wait for 1 second; 
if the list-size of LIST-1308 = 33 then
    begin
    post "regression for GENSYMCID-1308";
    return true, "GENSYMCID-1308 regressed";
    end;
return false,"";
end

gensymcid-1308-test(node: class benchmark-node )
status : truth-value;
status-text : text; 
win : class g2-window; 
begin
win = call rt-util-get-g2-server-window(); 
status, status-text = call gensymcid-1308-test-inner(win);
if status then 
    call fail(node,status-text)
else
    call pass(node);
call rt-util-show-ws-pretty-and-wait(the workspace of gensymcid-1308,win,1,0.1);
end

gensymcid-1919-test-inner() = (truth-value, text)

k:integer;
err : class error; 
err-text : text;
attribute-name : symbol = the symbol list-size; 

begin
repeat
    exit if the number of elements in LIST-1919 = 0;
    remove element 0 from LIST-1919;
    end;
insert "100" at the beginning of LIST-1919;
insert "200" at the beginning of LIST-1919;
insert "300" at the beginning of LIST-1919;
    begin
        conclude that the value that is an attribute of LIST-1919 named by attribute-name = 5;
    end
    on error (err) 
        err-text = the text of the error-description of err;
        delete err; 
        if is-contained-in-text("The attribute [attribute-name] of LIST-1919 is read-only",err-text) then begin
            post "success";
            return false,"";
        end;
    end;
post "failure";
return true,"Write access to the [attribute-name] of LIST-1919 should have failed, but it didn't"
        
end

gensymcid-1919-test(node: class benchmark-node )

status : truth-value;
status-text : text;

begin
status,status-text = call gensymcid-1919-test-inner();
if status then
    call fail(node, status-text)
else
    call pass(node);
end

gensymcid-1309-test-inner() = (truth-value, text)
begin
if the g2-list-sequence of list-1309 /= sequence() then
    return true, "list-1309 should be empty at the beginning of the test. Are you restarting tests w/o resetting the kb?";
    
insert "100" at the beginning of list-1309;
insert "100" at the beginning of list-1309;
insert "100" at the beginning of list-1309;
conclude that the g2-list-sequence of list-1309 = sequence("100","100");
if (the list-size of list-1309 /= the number of elements in the g2-list-sequence of list-1309) then
    return true, "regression: after inserting items and changing the g2-list-sequence, list-size does not match the number of elements in g2-list-sequence"; 
if (the list-size of list-1309 /= 2) then
    return true, "new problem: list-size of list-1390 must be = 2 after concluding the g2-list-sequence";
return false,"";
end

gensymcid-1309-test(node: class benchmark-node )
status : truth-value;
status-text : text; 
begin
status, status-text = call gensymcid-1309-test-inner();
if status then 
    call fail(node,status-text)
else
    call pass(node);
end

rt-util-send-key-by-symbol-and-wait( s : symbol, delay-after-sending : float ) 
{Clone of hit-enter from player}
 
code: integer;
begin
    code = call g2-key-code-from-symbol (s);
    call g2-generate-event (the symbol keystroke, code, 0, 0); 
    wait for delay-after-sending;
end

rt-util-get-g2-server-window () = (class g2-window)
win1,win2 : class g2-window;
begin
win2 = call get-main-g2-window();
for win1 = each g2-window do
    if the g2-window-management-type of win1 exists and the g2-window-management-type of win1 is local and the g2-window-width of win1 /= 22 then 
        begin
            if not (win1 is the same object as win2) then 
                post "get-main-g2-window is a crap";
            return win1;
        end;
    end;
end

rt-util-hide-each-kb-workspace-visible-on-window-and-wait (win : class g2-window, delay : float)
ws : class kb-workspace;
visible : truth-value; 
begin
  for ws = each kb-workspace do
     visible = call g2-item-is-showing-in-window (ws,win);
     if visible then
       begin
       post "[the class of ws] is visible - hiding it";
       hide ws; 
       end;
  end;
wait for delay; 
end

rt-util-show-ws-pretty-and-wait(ws: class kb-workspace , win: class g2-window, scale : float, delay : float)
begin
show ws at the center of the screen;
show ws scaled by (scale,scale);
call g2-lift-workspace-to-top(ws,win); 
wait for delay;
end
